#include <iostream>
#include <vector>

using namespace std;

/**
* https://leetcode.com/problems/two-sum-ii-input-array-is-sorted/?envType=study-plan&id=algorithm-i
*/

//O(n^2)
vector<int> twoSum1(vector<int>& numbers, int target) {
    vector<int> index;
    for(int index1=0; index1<numbers.size()-1; index1++) {
        for(int index2=index1+1; index2<numbers.size(); index2++) {
            if(numbers[index1] + numbers[index2] == target) {
                index.push_back(index1+1);
                index.push_back(index2+1);
                break;
            }
        }
    }
    return index;
}

//O(n)
vector<int> twoSum2(vector<int>& numbers, int target) {
    vector<int> index;
    int left = 0;
    int right = numbers.size() - 1;
    while(right > left) {
        if(numbers[right] + numbers[left] == target) {
            index.push_back(left + 1);
            index.push_back(right + 1);
            return index;
        } else if(numbers[right] + numbers[left] > target) {
            right--;
        } else {
            left++;
        }
    }
    return index;
}



